import React from 'react';

import Product from './Product';

class ItemGrid extends React.Component {
    render() {
        return (
            <section className='itemgrid'>
                <div className='container grid-three-column'>
                    <Product name="spreadsheets shirt" price="$24" image={this.props.boxa[0]}/>
                    <Product name="spreadsheets shirt" price="$24" image={this.props.boxa[1]}/>
                    <Product name="spreadsheets shirt" price="$24" image={this.props.boxa[2]}/>
                </div>
                <button className="main-btn-light-bc">
                    <a href="#more products">
                        more products
                    </a>
                </button>
            </section>
        );
    }
}

export default ItemGrid;

